// import the library
import { library } from '@fortawesome/fontawesome-svg-core';

// import your icons
import { faGoMarkGithub, FaLinkedinIn } from '@fortawesome/free-solid-svg-icons';

library.add(
  faGoMarkGithub,
  FaLinkedinIn,
  // more icons go here
)
